import React, { Component } from 'react';
import './AllProuducts.css';

class AllProuducts  extends Component {

    render() { 
        return (
          <div className = "AllProuducts">
          <div className="item items">
          <p>Product1</p>
          </div>
          <div className="item items">
          <p>Product2</p>
          </div>
          <div className="item items">
          <p>Product3</p>
          </div>
          <div className="item items">
          <p>Product4</p>
          </div>
          <div className="item items">
          <p>Product5</p>
          </div>
          <div className="item items">
          <p>Product6</p>
          </div>
          <div className="item items">
          <p>Product7</p></div>
          <div className="item items"><p>Product8</p></div>
          <div className="item items"><p>Product9</p></div>
          </div>
      );
  }
}

export default AllProuducts;
